    private static boolean hasFreeSpace(boolean[] axis, int limit, int size) {
        int count = 0;
        for (int i = 0; i <= size; i++) {
            if (axis[i]) {
                break;
            } else {
                count++;
                if (count == size) {
                    return true;
                }
            }
        }
        for (int i = count; i < limit; i++) {
            if (axis[i]) {
                count = 1;
            } else {
                count++;
                if (count == size) return true;
            }
        }
        return false;
    }
